const SWAPI_PEOPLE = 'people';

const getApiResource = async url => {
    let data;
    try {
        data = await (await fetch(url)).json();
    }
    catch(error) {
        console.log(error);
    }
    // data = fetch(SWAPI_ROOT+SWAPI_PEOPLE)
